// src/components/EditButton.js
import React from 'react';

const EditButton = ({ onClick }) => {
  return (
    <button onClick={onClick} className="edit-button">
      <img src="../styles/logos/2473159-200.png" alt></img>
    </button>
  );
};

export default EditButton;
